import React from "react";
import  ReactDOM   from "react-dom";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
function print(note){
return <div>
{note.key}
{note.title}
{note.content}
 </div>
}
function App(){
    return <div>
        <Header  />
        <Footer />
        notes.map(print);
    </div>
}

export default App;
